import React, { Component } from "react";
import "./components.css";

class Hero extends Component {
  state = {};
  render() {
    return (
      <div className="hero">
        Hello There!
        <div className="subhero">
          <ul>
            <li>Web Developer</li>
            <li>Graphic Designer</li>
          </ul>
        </div>
      </div>
    );
  }
}

export default Hero;
